import React from 'react';
import Navbar from 'react-bootstrap/Nav';
import { FaHome, FaThList, FaUsers, FaComments, FaUser } from "react-icons/fa";

export default () => {

    return (
    <Navbar justify variant="tabs" defaultActiveKey="/home" sticky="bottom" fixed="bottom">
        <Nav.Item>
            <Nav.Link href="/home"><FaHome /></Nav.Link>
        </Nav.Item>
        <Nav.Item>
            <Nav.Link eventKey="link-1"><FaThList /></Nav.Link>
        </Nav.Item>
        <Nav.Item>
            <Nav.Link eventKey="link-2"><FaUsers /></Nav.Link>
        </Nav.Item>
        <Nav.Item>
            <Nav.Link eventKey="link-2"><FaComments /></Nav.Link>
        </Nav.Item>
        <Nav.Item>
            <Nav.Link eventKey="link-2"><FaUser /></Nav.Link>
        </Nav.Item>
    </Navbar>
)}
